import React from "react";
import "./App.css";
import GameBoard from "./components/GameBoard";
import PlayerInfo from "./components/PlayerInfo";
import TimeTracker from "./components/TimeTracker";

const App = () => {
  return (
    <div className="App">
      <h1>Monopoly Game</h1>
      <TimeTracker />
      <PlayerInfo />
      <GameBoard />
    </div>
  );
};

export default App;
